import React from "react";
import { Jumbotron } from "react-bootstrap";

function Contact() {
  return (
    <div className="contact">
      <div className="container">
        <Jumbotron className="text-center">
          <h1>Contact Us</h1>
          <div className="container">
            
          </div>
        </Jumbotron>
      </div>
    </div>
  );
}

export default Contact;
